// src/pages/IA.js
import React from "react";
import Layout from "../components/Layout";

// Componente da página de IA
const IA = () => {
  return (
    // Usa o Layout que inclui a estrutura comum de navegação
    <Layout>
      {/* Conteúdo principal da página */}
      <h2>Página de Inteligência Artificial</h2>
      <p>Explore insights inteligentes sobre suas finanças.</p>
    </Layout>
  );
};

export default IA;
